class _WaterCoolerState extends State<WaterCooler> {
  
  @override
  Widget build(BuildContext context) {
     final id = Provider.of<MyCart1>(context);
    final String k = 'Cooling';
    return Scrollbar(
        child: ListView.separated(
            itemBuilder: (context, int index) {
              return GestureDetector(
                  onTap: () => {},
                  child: Card(color: Colors.yellowAccent, shape: RoundedRectangleBorder(
                        borderRadius: BorderRadius.circular(30)),
                    child: Container(
                        child: ListTile(
                      onTap: () => {
                        id.add(k,water[index]),
                        Navigator.pop(context),
                        //Navigator.push(context,
                        //MaterialPageRoute(builder: (context) => Main()))
    
                      },
                      title: Text(water[index]),
                      subtitle: Text(k),
                    )),
                  ));
            },
            shrinkWrap: true,
            separatorBuilder: (BuildContext context, int index) => Divider(),
            itemCount: water.length));
  }
}
